def make_images(size, number):

	'''
	Make a bunch of random images of a particular size x size
	:param size: int
	:return: list of matrices
	'''

	images = [[[random.choice([0, 1]) for _ in range(size)] for __ in range(size)] for ___ in range(number)]

	return images


def single_ca_image(initial_state, n_steps, rule_number):
	"""
	makes a single, square CA image
	:param initial_state: list of 0,1s
	:param n_steps: number of steps should be = to len initial_state (to make a square)
	:param rule_number: 0-255
	:return: list of lists (image)
	"""

	rule_string = np.binary_repr(rule_number, 8)
	rule = np.array([int(bit) for bit in rule_string])

	m_cells = len(initial_state)
	CA_run = np.zeros((n_steps, m_cells))
	CA_run[0, :] = initial_state

	for step in range(1, n_steps):
		all_triplets = np.stack(
			[
				np.roll(CA_run[step - 1, :], 1),
				CA_run[step - 1, :],
				np.roll(CA_run[step - 1, :], -1),
			]
		)
		CA_run[step, :] = rule[np.apply_along_axis(rule_index, 0, all_triplets)]

	return CA_run


def make_ca_images(n_images, size):
	"""
	make a bunch of CA images with quadrants
	Loop through a bunch of rules and random/single-cell initial conditions
	Pick random ones and paste together into a square image, where each quadrant is a CA
	:param n_images: Number of resulting images to make
	:param size: number of cells for square image
	:return: list of images (list of lists)
	"""

	initial_state = [random.choice([0,1]) for _ in range(size)]
	n_steps = size-1
	rule_number = random.choice([0,255])
	image = single_ca_image(initial_state, n_steps, rule_number)


def verify_pymils(images):

	'''
	Run three experiments that test that PyMils is working.
	Since these experiments do an exhaustive search on all possible row/column deletions, we can determine if pymils
	is running optimally.
	:param images: A list of small images (where each image is a list of lists).
	Only run on images that are max size 7, use make_images
	:return: None, just make plots
	'''

	# initialize the BDM class for part 3
	bdm1 = BDM(ndim=1)

	for image in images:

		# --------------------------------------------------------------
		# Part 1: Make the complete network of subsets and time it
		# --------------------------------------------------------------

		# make all possible subsets
		t0 = time.time()
		subsets = PyMILS.image_subsets_complete(image)
		dt = time.time() - t0
		print('Subsets: ' + str(dt))

		# map the data onto this indexed state space and measure bdm
		t0 = time.time()
		subset_bdms = PyMILS.batch_image_bdms(subsets, image)
		dt = time.time() - t0
		print('BDMs: ' + str(dt))

		# get the state space network
		t0 = time.time()
		bdm_tool = PyMILS.init_bdm()
		image_bdm = (image, PyMILS.image_bdm(np.array(image), bdm_tool))
		state_space = PyMILS.subset_state_space(subsets, subset_bdms, image_bdm)
		dt = time.time() - t0
		print('State space network: ' + str(dt))

		# --------------------------------------------------------------
		# Part 2: What do all the possible paths look like?
		# --------------------------------------------------------------

		# which "kind of paths" through the network preserve the BDM the best?
		# get all paths from start to cutoff size
		t0 = time.time()
		bdm_paths = PyMILS.all_path_bdms(state_space)
		dt = time.time() - t0
		print('Measuring paths: ' + str(dt))

		# plot these differences (each line is a possible trajectory from start image to a final image)
		t0 = time.time()
		lines = []

		for ab in bdm_paths.keys():
			for path in bdm_paths[ab]:
				line = bdm_paths[ab][path]
				line = np.cumsum(line)
				# the last of these values is the total BDM difference between the original image and the last image

				lines.append(line)

		[plt.plot(list(range(len(line))), line, linewidth=0.5) for line in lines]
		plt.show()

		dt = time.time() - t0
		print('Plot networks: ' + str(dt))

		# --------------------------------------------------------------
		# Part 3: Pick out the ones that stay at 0 and see if there's anything in common about them
		# --------------------------------------------------------------

		# make histogram of differences between start and end images
		total_diffs = []

		for ab in bdm_paths.keys():
			for path in bdm_paths[ab]:
				line = bdm_paths[ab][path]
				line = np.cumsum(line)
				# the last of these values is the total BDM difference between the original image and the last image
				# take diff abs value
				total_diffs.append(abs(line[-1]))

		plt.hist(total_diffs)
		plt.show()

		# get all total diffs and get their trajectory choices
		all_diffs = []

		for ab in bdm_paths.keys():
			for path in bdm_paths[ab]:
				line = bdm_paths[ab][path]
				line = np.cumsum(line)
				total_diff = abs(line[-1])  # just gets abs value for diff

				# translate to c or r for column or row removed
				path_nodes = ast.literal_eval(path)
				ncols = np.diff(list(map(lambda x: len(ast.literal_eval(x)), path_nodes)))
				nrows = np.diff(list(map(lambda x: len(ast.literal_eval(x)[0]), path_nodes)))

				choices = []

				for choice in zip(ncols, nrows):  # compare the two lists to get a single list
					if choice[0] == -1:
						choices.append(0)  # number of col changed, meaning a col was deleted
					else:
						choices.append(1)

				# For all the values close to 0, do we have to switch between c and r randomly?
				# 0 = c, 1 = r
				# Use BDM on the c-r trajectory to check!
				# Oh no! These strings are too small! They all have a BDM value of 0.
				# Let's make them X times as long by repeating them two extra times like aba --> abaabaaba
				# This is arbitrary, but as long as we do it to all of them then the differences won't matter
				# (we just want a rough estimate of the randomness of the trajectory of choices)
				bdm_choices = bdm1.bdm(np.array(choices + choices + choices + choices + choices))
				all_diffs.append((total_diff, bdm_choices, choices))

		# Plot total diff vs choice BDM for all the trajectories
		# Is there a trend? If not, then we can just sample paths randomly

		plt.scatter(list(map(lambda x: x[0], all_diffs)), list(map(lambda x: x[1], all_diffs)), s=1)
		plt.show()

		# It does not look like there is a trend (the horizontal bands are artifacts of BDM)


def random_images_varied_sizes(sizes, number):

	'''
	Makes a number of randomly-generated images for each size
	:param sizes: List of ints
	:param number: Int
	:return: None, makes some pickle files and some plots
	'''

	for size in sizes:

		images = make_images(size, number)

		data = {}

		for num, image in enumerate(images):

			print(num)

			bdm_tool = PyMILS.init_bdm()

			# test the speed of the code as a function of image size for random images

			# get BDM values for the 4 quadrants before the compression
			top_half = image[:int(len(image) / 2)]
			top_left = list(map(lambda x: x[:int(len(x) / 2)], top_half))
			top_right = list(map(lambda x: x[int(len(x) / 2):], top_half))
			bottom_half = image[int(len(image) / 2):]
			bottom_left = list(map(lambda x: x[:int(len(x) / 2)], bottom_half))
			bottom_right = list(map(lambda x: x[int(len(x) / 2):], bottom_half))

			bdm_top_left = bdm_tool.bdm(np.array(top_left))
